import React from "react";

const Folder = ({ folder, index, isActive, onClick, onCreateForm }) => (
  <div className={`folder-item ${isActive ? "active" : ""}`} onClick={onClick}>
    <h4>{folder.name}</h4>
    {isActive && (
      <div className="form-list">
        {folder.forms.map((form, idx) => (
          <div key={idx} className="form-item">
            <span>{form}</span>
          </div>
        ))}
        <button onClick={() => onCreateForm("New Form", index)}>Add Form</button>
      </div>
    )}
  </div>
);

export default Folder;
